function wdeTestDetectBorwser() {
    var browser = window.navigator.userAgent.toLowerCase();
    if (browser.indexOf("edge") != -1) {
        return "edge";
    }
    if (browser.indexOf("firefox") != -1) {
        return "firefox";
    }
    if (browser.indexOf("chrome") != -1) {
        return "chrome";
    }
    return browser;
}

function wdeTestSimulateSelection(start, end) {
    var range = window.frames['WDE_RTF'].document.createRange();
    var referenceNode = window.frames['WDE_RTF'].document.getElementById("wdeStartNode").firstChild;
    range.setStart(referenceNode, start);
    range.setEnd(referenceNode, end);
    window.frames['WDE_RTF'].document.getElementById("wdeStartNode").focus();
    var sel = window.frames['WDE_RTF'].getSelection();
    sel.removeAllRanges();
    sel.addRange(range);
}

function wdeTestLeadingZero(num) {
    if (num < 10) {
        return  '0' + num.toString();
    } else {
        return num.toString();
    }
}

function wdeTestAlert() {
    alert("Test was run");
}

function wdeTestOutCompString(a,b) {
    var nowTime = new Date();
    var mSeconds = nowTime.getTime() - wdeTestLastTime.getTime();
    wdeTestLastTime = nowTime;
    if (a == b) {
        wdeTestAddToOutput("[OK] - " + mSeconds + " ms\n");
    } else {
        wdeTestAddToOutput("[FAILED] - " + mSeconds + " ms\n");
        wdeTestFailed = 1;
    }
}

function wdeTestAddToOutput(toAdd) {
    wdeTestOutput += toAdd;
    window.frames['WDE_TEST_OUT'].document.body.innerHTML = "<pre>\n" + wdeTestOutput + "\n</pre>";
    wdeShowTab('tab7','WDE_settings');
}

function wdeTestPRStringAsFunction() {
    if (wdeTestPRString == "") {
        return;
    }
    var retStr = "function wdeTestDataString_000() {\n    var str = \"";
    var j = 10;
    for (var i = 0 ; i < wdeTestPRString.length ; i++) {
        if (j > 59) {
            retStr += "\" +\n    \"";
            j = 0;
        }
        if (wdeTestPRString.charAt(i) == "\n") {
            retStr += "\\n";
            j++;
        } else if (wdeTestPRString.charAt(i) == "<") {
            retStr += "&lt;";
        } else if (wdeTestPRString.charAt(i) == ">") {
            retStr += "&gt;";
        } else if (wdeTestPRString.charAt(i) == "&") {
            retStr += "&amp;";
        } else if (wdeTestPRString.charAt(i) == "\"") {
            retStr += "\\\"";
            j++;
        } else{
            retStr += wdeTestPRString.charAt(i);
        }
        j++;
    }
    retStr += "\";\n    return str;\n}\n";
    
    window.frames['WDE_TEST_OUT'].document.body.innerHTML = "<pre>\n" + retStr + "\n</pre>";
    wdeShowTab('tab7','WDE_settings');
}

function wdeTestPRStringAsFunction2() {
    if (wdeTestPRString == "") {
        return;
    }
    var retStr = "function wdeTestDataString_000() {\n    var str = '";
    var j = 10;
    for (var i = 0 ; i < wdeTestPRString.length ; i++) {
        if (j > 59) {
            retStr += "' +\n    '";
            j = 0;
        }
        if (wdeTestPRString.charAt(i) == "\n") {
            retStr += "\\n";
            j++;
	    } else if ((wdeTestPRString.charAt(i) == ",") && 
	               (wdeTestPRString.charAt(i -1 ) == "]")) {
	        retStr += ",' +\n    '";
	        j = 0;
        } else if (wdeTestPRString.charAt(i) == "<") {
            retStr += "&lt;";
        } else if (wdeTestPRString.charAt(i) == ">") {
            retStr += "&gt;";
        } else if (wdeTestPRString.charAt(i) == "&") {
            retStr += "&amp;";
        } else if (wdeTestPRString.charAt(i) == "'") {
            retStr += "\\'";
            j++;
        } else{
            retStr += wdeTestPRString.charAt(i);
        }
        j++;
    }
    retStr += "';\n    return str;\n}\n";
    
    window.frames['WDE_TEST_OUT'].document.body.innerHTML = "<pre>\n" + retStr + "\n</pre>";
    wdeShowTab('tab7','WDE_settings');
}


